import React, {ReactElement} from "react";

export enum PathEnum {
    signUp = 'sign-up',
    signIn = 'sign-in',
    bookings  = 'bookings',
    tripInfo = 'trip/:tripId',
}

export interface IRoute {
    path?: PathEnum,
    renderFunc: () => ReactElement,
    index?: boolean
}
